window.addEventListener("DOMContentLoaded", () => {
  document.getElementById("avaliacaoForm").addEventListener("submit", function (e) {
    e.preventDefault();
    const form = e.target;

    // Coleta dados do formulário
    const nome = form.nome.value;
    const nascimento = form.nascimento.value;
    const posicao = form.posicao.value;
    const modalidade = form.modalidade.value;
    const estilo = form.estilo.value;
    const outros_obj = form.outros_objetivos.value;
    const objetivos = Array.from(form.querySelectorAll('input[name="objetivos"]:checked')).map(cb => cb.value);

    const goleiro_taticos = form.goleiro_taticos.value;
    const goleiro_tecnicos = form.goleiro_tecnicos.value;
    const goleiro_fisico = form.goleiro_fisico.value;
    const goleiro_psico = form.goleiro_psicologico.value;
    const goleiro_sociais = form.goleiro_sociais.value;

    const { jsPDF } = window.jspdf;
    const doc = new jsPDF({ unit: 'pt', format: 'a4', orientation: 'portrait' });
    const pageWidth = doc.internal.pageSize.getWidth();
    const pageHeight = doc.internal.pageSize.getHeight();
    const marginX = 50;
    const lineHeight = 20;
    const logoSize = 100;

    let y = 10 + logoSize + 20; // ajuste após o logo

    const logoBase64 = "data:image/png;base64,";
    const imgSuperiorDireita = "data:image/png;base64,";
    const imgInferiorEsquerda = "data:image/png;base64,";


    // Título
    doc.setFont("helvetica", "bold");
    doc.setFontSize(22);
    doc.text("FICHA DE TREINAMENTO", pageWidth / 2, y, { align: "center" });
    y += 30;

    doc.setFont("helvetica", "normal");
    doc.setFontSize(12);
    doc.text("Documento Autodeclarado – Uso exclusivo do personal trainer", pageWidth / 2, y, { align: "center" });
    y += 40;

    // Dados Pessoais
    doc.setFont("helvetica", "bold");
    doc.setFontSize(16);
    doc.text("Dados Pessoais", marginX, y);
    doc.line(marginX, y + 4, pageWidth - marginX, y + 4);
    y += 30;

    const spacing = 12;
    const campos = [
      { label: "Nome completo:", value: nome },
      { label: "Ano de nascimento:", value: nascimento },
      { label: "Posição em campo:", value: posicao },
      { label: "Modalidade:", value: modalidade },
      { label: "Estilo de jogo:", value: estilo },
    ];

    doc.setFontSize(12);
    campos.forEach(({ label, value }) => {
      doc.setFont("helvetica", "bold");
      doc.text(label, marginX, y);
      doc.setFont("helvetica", "normal");
      doc.text(value || "-", marginX + doc.getTextWidth(label) + spacing, y);
      y += lineHeight;
    });

    y += 20;

    // Objetivos Gerais do Treino
    doc.setFont("helvetica", "bold");
    doc.setFontSize(16);
    doc.text("Objetivos Gerais do Treino", marginX, y);
    doc.line(marginX, y + 4, pageWidth - marginX, y + 4);
    y += 30;

    if (outros_obj) {
      doc.setFont("helvetica", "italic");
      doc.setFontSize(12);
      const textoCompleto = `Outros objetivos: ${outros_obj}`;
      const maxWidth = pageWidth - 2 * marginX;
      const larguraTexto = doc.getTextWidth(textoCompleto);
      const textoFinal = larguraTexto > maxWidth
        ? textoCompleto.slice(0, 100) + "..."
        : textoCompleto;
      doc.text(textoFinal, marginX, y);
      y += 20;
    }

    doc.setFont("helvetica", "normal");
    doc.setFontSize(11);
    if (objetivos.length) {
      objetivos.forEach(obj => {
        doc.text(`• ${obj}`, marginX, y);
        y += 13;
      });
    } else {
      doc.text("-", marginX, y);
      y += 13;
    }

    y += 20;

    // Avaliação Goleiro
    doc.setFont("helvetica", "bold");
    doc.setFontSize(16);
    doc.text("Avaliação Específica - Goleiro", marginX, y);
    doc.line(marginX, y + 4, pageWidth - marginX, y + 4);
    y += 30;

    const avaliacaoFields = [
      { label: "Táticos", value: goleiro_taticos },
      { label: "Técnicos", value: goleiro_tecnicos },
      { label: "Capacidade Física", value: goleiro_fisico },
      { label: "Aspectos Psicológicos", value: goleiro_psico },
      { label: "Comportamento Social", value: goleiro_sociais },
    ];

    const lineHeightLocal = 14;
    const maxChars = 200;

    doc.setFont("helvetica", "normal");
    doc.setFontSize(11);
    avaliacaoFields.forEach(({ label, value }) => {
      const texto = `${label}: ${value ? value.slice(0, maxChars) : "-"}`;
      const linhas = doc.splitTextToSize(texto, pageWidth - 2 * marginX);
      doc.text(linhas, marginX, y);
      y += linhas.length * lineHeightLocal;
    });

    y += 30;

    // Observações Finais
    doc.setFont("helvetica", "bold");
    doc.setFontSize(12);
    doc.text("Observações Finais", marginX, y);
    doc.line(marginX, y + 4, pageWidth - marginX, y + 4);
    y += 30;

    doc.setFont("helvetica", "italic");
    doc.setFontSize(12);
    doc.text("(Espaço reservado para anotações complementares do personal trainer)", marginX, y);
    y += 20;

    doc.setFont("helvetica", "normal");
    for (let i = 0; i < 2; i++) {
      doc.line(marginX, y, pageWidth - marginX, y);
      y += 20;
    }

    // Imagens

    

    doc.addImage(logoBase64, "PNG", (pageWidth - logoSize) / 2, 10, logoSize, logoSize);
    doc.addImage(imgSuperiorDireita, "PNG", pageWidth - logoSize, -5, logoSize, logoSize);
    doc.addImage(imgInferiorEsquerda, "PNG", 0, pageHeight - logoSize, logoSize, logoSize);

   


    // Assinaturas
    y += 25;
    const assinaturaWidth = 160;
    const center1 = pageWidth / 2 - assinaturaWidth - 30;
    const center2 = pageWidth / 2 + 30;
    doc.line(center1, y, center1 + assinaturaWidth, y);
    doc.text("Assinatura do Aluno", center1 + assinaturaWidth / 2, y + 15, { align: "center" });
    doc.line(center2, y, center2 + assinaturaWidth, y);
    doc.text("Assinatura do Personal", center2 + assinaturaWidth / 2, y + 15, { align: "center" });

    // Rodapé
    doc.setFont("helvetica", "italic");
    doc.setFontSize(10);
    doc.setTextColor(100);
    doc.text("ricardoguiportifolio.netlify.app", pageWidth / 2, pageHeight - 30, { align: "center" });

    // Gera o PDF em Blob
    const pdfBlob = doc.output("blob");

    // Abre o PDF gerado numa nova aba
    const url = URL.createObjectURL(pdfBlob);
    window.open(url);

    // Envia o PDF para o backend
    const formData = new FormData();
    formData.append("pdf", pdfBlob, "avaliacao.pdf");
    formData.append('nome', nome);  // adiciona o nome ao form data

    fetch("https://projeto-pdf4-1.onrender.com/enviar-pdf", {
      method: "POST",
      body: formData,
    })
      .then(res => res.json())
      .then(data => {
        if (data.success) {
          alert("PDF enviado ao email do professor");
          form.reset();
        } else {
          alert("Erro ao enviar PDF: " + (data.error || "Desconhecido"));
        }
      })
      .catch(err => alert("Erro ao enviar: " + err.message));
  });
});
